import API from "@/api";
import Vue from "vue";
export default {
  data: function data() {
    return {
      beginTime: "",
      endTime: "",
      powerType: "",
      dataSource: "",
      //表格当前页数据
      tableData: [],
      //多选数组
      multipleSelection: [],
      //搜索条件
      criteria: "",
      //下拉菜单选项
      select: "",
      //默认每页数据量
      pagesize: 10,
      //默认高亮行数据id
      highlightId: -1,
      //当前页码
      currentPage: 1,
      //查询的页码
      start: 1,
      //默认数据总数
      totalCount: 1000,
      formLabelWidth: "120px",
      list: ""
    };
  },
  created: function created() {
    this.loadData(this.criteria, this.currentPage, this.pagesize);
    this.loadMenu();
  },
  methods: {
    //从服务器读取数据
    loadData: function loadData(criteria, pageNum, pageSize) {
      var _this = this;

      var params = {
        parameter: criteria,
        pageNum: pageNum,
        pageSize: pageSize
      };
      API.userUtil.getData(params).then(function (_ref) {
        var data = _ref.data;
        console.log(data);

        if (data.status == 0) {
          _this.tableData = data.data.userData;
          _this.totalCount = data.data.number;
        } else {
          //this.$Message.error(data.msg);
          _this.$message("请求失败！");
        }
      }).catch(function (data) {
        _this.$message("请求失败ww！");

        console.log(data);
      });
    },
    selectMenu: function selectMenu(key, keyPath, name) {
      console.log("key:" + key + "keyPath:" + keyPath);
      console.log(name);
    },
    //加载树状图
    loadMenu: function loadMenu() {
      var _this2 = this;

      API.ertusUtil.getErtus().then(function (_ref2) {
        var data = _ref2.data;
        console.log(data.data);

        if (data.status == 0) {
          _this2.list = data.data;
        } else {
          //this.$Message.error(data.msg);
          _this2.$message("请求失败！");
        }
      }).catch(function (data) {
        _this2.$message("请求失败ww！");

        console.log(data);
      });
    },
    //多选响应
    handleSelectionChange: function handleSelectionChange(val) {
      this.multipleSelection = val;
    },
    //点击行响应
    handleclick: function handleclick(row, event, column) {
      this.highlightId = row.id;
    },
    //搜索
    search: function search() {
      console.log(this.select);
      this.loadData(this.criteria, this.currentPage, this.pagesize);
    },
    add: function add() {
      this.addFormVisible = true;
    },
    exportData: function exportData() {
      window.location.href = "http://localhost:8088/api/exportUser.do";
    },
    //改变当前点击的行的class，高亮当前行
    tableRowClassName: function tableRowClassName(row, index) {
      if (row.id == this.highlightId) {
        return "info-row";
      }
    },
    //每页显示数据量变更
    handleSizeChange: function handleSizeChange(val) {
      this.pagesize = val;
      this.loadData(this.criteria, this.currentPage, this.pagesize);
    },
    //页码变更
    handleCurrentChange: function handleCurrentChange(val) {
      this.currentPage = val;
      this.loadData(this.criteria, this.currentPage, this.pagesize);
    }
  }
};
